import React from "react";
import { useAuth } from "../context/AuthContext";
import HistoryTable from "../components/HistoryTable";

const PhysioProfile = () => {
  const { user } = useAuth();

  // Simulação de dados (substituir por API futuramente)
  const historyData = [
    { anoMes: "02/2025", sessoes: 8, sRetencao: 500, cRetencao: 450 },
    { anoMes: "01/2025", sessoes: 10, sRetencao: 600, cRetencao: 540 },
  ];

  return (
    <div className="p-6 bg-white shadow-lg rounded-lg">
      <h2 className="text-2xl font-semibold mb-4">Perfil do Fisioterapeuta</h2>
      <div className="mb-2">
        <strong>Nome:</strong> {user?.name || "Profissional de Saúde"}
      </div>
      <div className="mb-2">
        <strong>Nome de utilizador:</strong> {user?.username || "N/A"}
      </div>
      <div className="mb-2">
        <strong>Data de Registo:</strong> {user?.registrationDate || "N/A"}
      </div>
      <div className="mb-2">
        <strong>Última visita:</strong> {user?.lastVisit || "N/A"}
      </div>

      {/* Seção do Histórico de Montantes Recebidos */}
      <HistoryTable data={historyData} />
    </div>
  );
};

export default PhysioProfile;
